import React, { useEffect } from "react";
import M from 'materialize-css/dist/js/materialize.min.js';
import BookList from './components/booklist';


function App() {
    useEffect(() => {
      M.AutoInit();
  });

  return (
    <div>
      <BookList/>
    </div>
  );
}

export default App;
